import React, { Component } from 'react';
import './App.css';

const todos = [
  'Buy milk',
  'Wash car',
];

class App extends Component {
  render() {
    return (
      <div className="container">
        <h1 className="center red-text">todos</h1>

      </div>
    );
  }
}

export default App;
